export default {
  apiKey: 'your_google_map_api_key',
};

export const mapboxConfig = {
  tileLayer: 'https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png',
  maxZoom: 18,
  defaultZoom: 11,
  center: [40.706877, -74.011265],
};
